import React, {Component} from 'react';
import './homepage.css';

class Homepage extends Component{
    constructor(){
        super();
        this.state ={
          error: null,
          isLoaded: false,
          items: [],
        }
    }
    componentDidMount(){
      fetch("https://api.spaceXdata.com/v3/launches?limit=10")
      .then(res => res.json())
      .then(
        (result) => {
            console.log(result)
          this.setState({
            isLoaded: true,
            items: result
          });
        },
        (error) => {
          this.setState({
            isLoaded: true,
            error
          });
        }
      )
    }
    render(){

      let count = 0;


      const { error, isLoaded, items } = this.state;
      if (error) {
        return <div>Error: {error.message}</div>;
      } else if (!isLoaded) {
        return <div>Loading...</div>;
      } else {
        return (
          <div className="main" id="main">
            {/* <div> */}
                 {items.map((item) => (
                    // {item.launch_year}
                // <img src={item.links.mission_patch_small}/>
                <div className="card">
                    <img src={item.links.mission_patch_small} />
                    <div className="container">
                 <h4><b>{item.mission_name}</b></h4>
                 <h4>Mission Id: </h4><span>{item.mission_id}</span>
                 <h4>Launch Year: </h4><span>{item.launch_year}</span>
                 <h4>Successful Launch: </h4><span>{item.launch_success}</span>
                 <h4>Successful Landing: </h4><span>{item.rocket.first_stage}</span>

                    </div>
                </div>
                ))}
                {/* </div> */}
            <div className="card">
                {/* <img src="img_avatar.png" alt="Avatar" style="width:100%"> */}
                <div className="container">
                    <h4><b>John Doe</b></h4>
                    {/* <p>Architect & Engineer</p> */}
                </div>
                </div>
          </div>
        );
      }
    }
}

export default Homepage;
